 function Product({products,onDelete}) {
    return (
    <div className='box'>
        <div>`Author {products.author}`</div>
        <div>{products.name}</div>
        <div>{products.qoute}</div>
        <button onClick={()=>onDelete(products.id)}>Delete</button>
    </div>
  )
}
export default Product
